import React from "react" 
import Typewriter from "typewriter-effect"

 const Home = () => {
    return (
      <div>
        <h1>
          <div>
          <Typewriter
          options={{
            autoStart: true,
            loop: true,
            delay: 70,

            pauseFor: 5000,
            strings: ["Hello I am Roniel Overton. I am a FullStack web developer and welcome to my portfolio"]
          }}
          />  
          </div>
        </h1>
      </div>
    )
 }
export default Home
